from math import *
def Cos(a):
	return cos(radians(a))
def Sin(a):
	return sin(radians(a))
def Acos(a):
	return degrees(acos(a))
def Round(a,k):
	try :
		x = list(str(a)).index('.')
	except:
		a += 0.0
	if k < len([list(str(a))[i] for i in range(list(str(a)).index('.')+1,len(list(str(a))))]):
		o = [list(str(a))[i] for i in range( k + list(str(a)).index('.') + 1)]
	else:
		o = list(str(a))
	return float(''.join(o))
def Vec(a,b,pr):
	return (Round(b[0] - a[0],pr), Round(b[1] - a[1],pr), Round(b[2] - a[2],pr))
def Nor(a):
	return sqrt(a[0]**2 + a[1]**2 + a[2]**2)
def Sca(a,b):
	return a[0]*b[0] + a[1]*b[1] + a[2]*b[2]
def Prod(a,b,pr):
	return (Round(b[0] * a,pr), Round(b[1] * a,pr), Round(b[2] * a,pr))
def Sous(a,b,pr):
	return (Round(a[0] - b[0],pr), Round(a[1] - b[1],pr), Round(a[2] - b[2],pr))
def Conv(al,z,pr):
	a = [al[0] % 360, al[1] % 360]
	l = [Cos(a[0]), Cos(a[1]),Sin(a[0]),Sin(a[1]) ]
	if a[0] == 90:
		l[0] = 0
	if a[0] == 180:
		l[2] = 0
	if a[0] == 270:
		l[0] = 0
	if a[1] == 90:
		l[1] = 0
	if a[1] == 180:
		l[3] = 0
	if a[1] == 270:
		l[1] = 0
	return (Round(l[0] * l[1] * z,pr),Round(l[2] * l[1] * z,pr),Round(l[3] * z,pr))
def Proj_Ortho(po,pl,r):
	t = (-pl[0]*po[0]-pl[1]*po[1]-pl[2]*po[2]-r)/(pl[0]**2+pl[1]**2+pl[2]**2)
	p = (po[0] + pl[0] * t,po[1] + pl[1] * t,po[2] + pl[2] * t)
	return p
